import Delivery from './delivery'
import Acy from './acrylic'
import "../App.css";
function BasicExample() {
  return (
    <>
      <div class="bg-img ">
        <div >
        <Delivery/>
        </div> 
          <div className="col-lg-2 col-sm-3 col-5 mx-auto mb-4 ">
            <img
              className="img-fluid "
              style={{marginTop:'-3rem',height:'50vh', width:'600px'}}
              src="https://static.tildacdn.com/tild3039-3665-4939-b335-363731646332/noroot.png"
              alt="fatima"
            />
          </div>
          
          <div >
       <Acy/>
       </div>
      </div>
    </>
  );
}

export default BasicExample;
